        cum = []
        acc = 0
        for cell in row:
            acc = acc + 1 if cell == '.' else 0
            cum.append(acc)
        mp.append(cum)
    mp.append([-1] * w)
    max_area = 1
    for i in range(w):
        stack = []
        for j in range(h + 1):
            score = mp[j][i]
            if not stack:
                stack.append((score, j))
            else:
                (last_score, last_ind) = (stack[-1][0], stack[-1][1])
                if score > last_score:
                    stack.append((score, j))
                elif score == last_score:
                    continue
